import React, { useState } from 'react'
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import { useNavigate } from 'react-router-dom'

export default function AdminLogin() {
    const direct = useNavigate()
    
    const [ email ,setEmail ] = useState('')
    const [ pass ,setP ] = useState('')


    

    return (
        <div style={{ backgroundColor: "lightblue", height: "100vh", display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }} className='wrapper__form'>
            <Form style={{ maxWidth: '800px', margin: 'auto', padding: '1rem' }}>
                <Form.Group className="mb-3 " controlId="formBasicEmail">
                    <Form.Label>Email address</Form.Label>
                    <Form.Control type="email" placeholder="Enter email" required />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicPassword">
                    <Form.Label>Password</Form.Label>
                    <Form.Control type="password" placeholder="Password" required />
                </Form.Group>
                <Button onClick={() => {
                    direct('/panel')
                }} style={{ width: "100%" }} variant="info" type="submit">
                    Login
                </Button>
            </Form>
        </div>
    )
}
